package wee1.day2;

public class FindOddNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int num=10;
		for (int i = 0; i < num; i++) {
			if(i%2==1) {
				System.out.println(i);}
			
		}
		
		int[] scors = {1,2,3,4};
		System.out.println(scors[3]);
	}

}
